def dijkstra(graph, start, end):
 # initialize distances and visited set
 dist = {node: float('inf') for node in graph}
 visited = set()

 # set the distance of the starting node to 0
 dist[start] = 0

 # loop until all nodes are visited or the end is found
 while len(visited) < len(graph):
   # find the unvisited node with the smallest distance
   min_node = None
   for node in graph:
     if node not in visited and (min_node is None or dist[node] < dist[min_node]):
       min_node = node

   # mark the node as visited and update its neighbors' distances
   visited.add(min_node)
   for neighbor, weight in graph[min_node].items():
     if neighbor not in visited:
       # calculate the distance from the starting node to the neighbor
       new_dist = dist[min_node] + weight

       # update the distance if it is smaller than the current one
       if new_dist < dist[neighbor]:
         dist[neighbor] = new_dist

   # find the end node
   end_node = None
   for node in graph:
     if node == end and node not in visited:
       end_node = node
       break

   # check if the end node was found or all nodes were visited
   if (end_node is None) or (len(visited) == len(graph)):
     break

 # return the distance to the end node
 return dist[end]

